  {name: "Ubuntu Linux 14.04 DVD - Includes both 32-bit and 64-bit Versions - Long Term Support", price: 3.49, description: "Ubuntu is designed to work beautifully on the latest laptops, desktops and touch screen devices, it looks incredible on high resolution screens - and with touch screen enhancements and interface refinements including individual menu bars in each application window, it's now even easier to use.\nWith the included Firefox web browser, you can surf safely and with the confidence that your files and data will stay protected - thanks to the built-in firewall and virus protection. And if a potential vulnerability appears, we provide automatic updates which you can install in a single click.\nUbuntu works brilliantly with a range of devices. Simply plug in your MP3 player, camera or printer and you'll be up and running straightaway. No fuss. And Ubuntu is compatible with Windows files too, so you can open, edit and share Microsoft Office documents stress-free.\nCreate professional documents, spreadsheets and presentations with Ubuntu. LibreOffice is also included and is easy to use and is packed with the features you need.\nUbuntu is packed with apps for quick and easy communication. Empathy helps you integrate your chat accounts. And with Thunderbird, you can access your emails, address book and calendar.  All included!\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51f0i-c2nEL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Ubuntu-Linux-14-04-DVD-Includes/dp/B00JRSOCNM%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00JRSOCNM", rating: 3.8, category: "Software"},
