  {name: "Xbox One 1TB Console - Halo 5: Guardians Limited Edition Bundle", price: 479.99, description: "Includes: a 1TB hard drive custom Halo designed console, a uniquely designed Spartan themed Steel Book containing a full game digital download of Halo 5: Guardians, Warzone REQ Pack which includes 14 Premium Requisition packs to enhance Spartan combat, FOTUS-class armor, and a multiplayer emblem.\nIncludes a Guardian model by Metal Earth, Halo: The Fall of Reach - Animated Series, and Spartan Locke's Classified Orders.\nIncludes custom Halo sound effects for turning the console on, off, and disc eject.\nIncludes a 1TB hard drive to store games and media, an Xbox One Chat Headset, 14-day trial of Xbox Live Gold, HDMI Cord, and an AC Power Cable.\nXbox Live Gold Members who play Halo 5: Guardians by November 7, 2015 will receive the Teishin Raikou Armor Set (code delivered by Xbox Live).\nStarting November 12th, 2015: Play select Xbox 360 games on your Xbox One with backwards compatibility.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51muevtPAdL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Xbox-One-1TB-Console-Guardians-Limited/dp/B0136JP9OS%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB0136JP9OS", rating: 0.0, category: "Video Games"},
