  {name: "1-Year PlayStation Plus Membership - PS3/ PS4/ PS Vita [Digital Code]", price: 49.99, description: "Free hit games on your PS4, PS3, and PS Vita systems, with new free games added every month\nOnline Multiplayer on the PS4 system\nOne membership works across PS4, PS3 and PS Vita systems\nPS Plus Membership can be stacked\nNew Games every month with Instant Game Collection.\nNext-generation online multiplayer on the PS4 system.\nOne membership will extend to your PS4, PS3, and PS Vita systems.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51yFbiuXERL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/1-Year-PlayStation-Plus-Membership-Digital/dp/B004RMK5QG%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB004RMK5QG", rating: 0.0, category: "Digital Video Games"},
  {name: "PlayStation TV", price: 30.98, description: "Hundreds of PlayStation games to choose from: Including many PlayStation Vita games such as Killzone: Mercenary, God of War Collection, and Borderlands 2, classic games from PS One and PSP systems, and more.\nRemote Play: Stream most of your PS4 games from your PS4 system to your PlayStation TV over local Wi-Fi (robust Wi-Fi or wired connection recommended).\nEasy to Set up and Play: Plug in and play on any HDMI compatible TV in your home.\nPlayStationNow READY: Available later this year, PlayStation Now will give access to an expanding library of PS3 games to stream directly to PlayStation TV.\nAccess to Entertainment: Games, movies, TV shows, and apps on PlayStation Store.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/31bew7kzZZL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/PlayStation-TV-vita/dp/B00KVMHSUM%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00KVMHSUM", rating: 0.0, category: "Video Games"},
  {name: "PlayStation 4 Console with Free The Last of Us Remastered Voucher", price: 349.0, description: "Includes a digital game voucher for The Last of Us Remastered.\n\"Suspend mode\" eliminates the load time on your saved game and allows you to immediately return to where you left off by pressing the power button.\nPS4 enables the greatest game developers in the world to unlock their creativity and push the boundaries of play through a platform that is tuned specifically to their needs.\nEngage in endless personal challenges between you and your community, and share your epic moments for the world to see.\nGamers can share their epic triumphs by hitting the \"SHARE button\" on the controller, scan through the last few minutes of gameplay, tag it and return to the game.\nDeepen your gaming experience with <a href=\" http://www.amazon.com/dp/B004RMK5QG/ref=PS4PSPlus\" target=\"_blank\">PlayStation Plus</a>  and <a href=\"http://www.amazon.com/dp/B00GAC1D2G/ref=PS4GC\" target=\"_blank\">PlayStation Gift Cards</a>.\nPlayStation 4 redefines rich and immersive gameplay with powerful graphics and speed, intelligent personalization, deeply integrated social capabilities, and innovative second-screen features\nBackground downloading and updating capability also allows you to immediately play digital titles as they download, or update the system when the hardware is powered off.\nPlayStation 4 lets you instantly share images and videos of your favorite gameplay moments on Facebook with a single press of the \"share\" button on the Dualshock 4 controller.\nBroadcast while you play in real-time through Ustream, allowing friends to comment or jump into your game in new ways.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41nhsd2RrqL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/PlayStation-Console-Free-Remastered-Voucher-4/dp/B00RY3GIDE%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00RY3GIDE", rating: 0.0, category: "Video Games"},
  {name: "Sony PlayStation 3 Slim 320 GB Charcoal Black Console", price: 469.99, description: "New slimmer, lighter PS3 system, Wireless controller\n320GB HDD for storing games, music, videos, and photos\nStreams thousands of movies and TV shows instantly from Netflix\nBuilt-in Blu-ray player with 3D capabilities. HDMI output for 1080p resolution.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41Ev0ryNToL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Sony-PlayStation-Charcoal-Black-Console-3/dp/B003VUO6LU%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB003VUO6LU", rating: 4.2, category: "Video Games"},
  {name: "PlayStation 4 Black Friday Bundle - Grand Theft Auto V and The Last of Us Remastered", price: 455.0, description: "Bundle includes: black PlayStation 4 System 500 GB, black DualShock 4 Wireless Controller, AC Power Cord, HDMI Cable, Mono Headset, USB 2.0 Cable, Grand Theft Auto V and a The Last of Us: Remastered download voucher\nGrand Theft Auto V for the PlayStation 4 system features across-the-board graphical and technical enhancements for a deeper, more vibrant world.\nTransfer your existing Grand Theft Auto Online characters and progress, from PS3 or Xbox 360 to the PlayStation 4 version.\nReturning players to Grand Theft Auto V get exclusive vehicles, weapons, collectibles and more.\nExplore the beautiful, decimated world of The Last of Us Remastered, fully realized with the power of the PlayStation 4 system.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51tX9-Qx6xL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/PlayStation-Black-Friday-Bundle-Remastered-4/dp/B00O9JLAX4%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00O9JLAX4", rating: 0.0, category: "Video Games"},
  {name: "DualShock 4 Wireless Controller for PlayStation 4 - Jet Black", price: 42.0, description: "Precision Control: The feel, shape, and sensitivity of the DualShock 4’s analog sticks and trigger buttons have been enhanced to offer players absolute control for all games on PlayStation 4.\nSharing at your Fingertips: The addition of the Share button makes sharing your greatest gaming moments as easy as a push of a button. Upload gameplay videos and screenshots directly from your system or live-stream your gameplay, all without disturbing the game in progress.\nNew ways to Play: Revolutionary features like the touch pad, integrated light bar, and built-in speaker offer exciting new ways to experience and interact with your games and its 3.5mm audio jack offers a practical personal audio solution for gamers who want to listen to their games in private.\nCharge Efficiently: The DualShock 4 Wireless Controller can easily be recharged by plugging it into your PlayStation 4 system, even when on standby, or with any standard charger with a micro-USB port.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41ih-c4lfVL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/DualShock-Wireless-Controller-PlayStation-Black-4/dp/B00BGA9X9W%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00BGA9X9W", rating: 0.0, category: "Video Games"},
  {name: "TNP PS4 Vertical Stand Cooler - Dual Charger Dock Charging Station for Sony Playstation 4 Dual Shock Controllers Cooling System with 2 Fans and 3 USB Ports Black [Playstation 4]", price: 16.95, description: "Ultimate Cooler - Keep your Playstation 4 cool and calm with the vertical cooling stand. No worrying about your ps4 overheating and burning your table from long hours of game play\nFree Charging Station - Not only does this keep your playstation 4 from over-heating, it also sports a dual charging station to charge both your controllers simultanisouly using the built in usb ports\nVertical Play - Normally your ps4 sits horizontal taking up space within your room. However, with this vertical stand, your ps4 now stands vertically, saving you lots of room space while cooling your ps4 at the same time\nUnique Appearance - This Veritcal Stand is cool in both ways. Its fan keeps the system cooling at the same time looking cool in itself due to the unique design and charging docks included\nConvienience - Save Space, time and charge your two controllers at the same time without having to worry where to keep your accessories. Its simply convienience at its best\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41GSrkQWcnL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/TNP-PS4-Vertical-Stand-Cooler-Playstation/dp/B013HOBSB0%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB013HOBSB0", rating: 0.0, category: "Video Games"},
  {name: "FIFA 16 - Standard Edition - PlayStation 4", price: 44.95, description: "Includes the standard edition of FIFA 16 for PlayStation 4.\nSupports single-player, local multiplayer, and online multiplayer.\nInterception Intelligence - Rewritten for FIFA 16, Interception Intelligence can be adjusted in Custom Tactics so you can control how aggressive your teammates are on the ball.\nNo Touch Dribbling - Lionel Messi was motion captured to create an innovative dribble control system that gives players the freedom to decide not just how, but when to touch the ball.\nWomen's National Teams - For the first time ever in an EA SPORTS FIFA franchise title, compete with 12 top-ranked Women's National Teams.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51xvqYOzb0L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/FIFA-16-Standard-Edition-PlayStation-4/dp/B00YC7ECXS%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00YC7ECXS", rating: 0.0, category: "Video Games"},
  {name: "500GB PlayStation 4 Batman Arkham Knight Bundle Limited Edition", price: 473.59, description: "Includes: Limited Edition Batman 500 GB PlayStation 4 System, 1 DualShock 4 Wireless Controller, AC Power Cable, HDMI Cable, USB 2.0 Cable, Mono Wireless Headset, and a physical copy of Batman: Arkham Knight Limited Edition\nLimited Edition PlayStation 4 in Steel Gray with custom Batman: Arkham Knight Silk Screened Face Plate\nLimited Edition DUALSHOCK 4 Wireless Controller in Steel Gray\nIn the explosive finale to the Arkham series, Batman faces the ultimate threat against the city he is sworn to protect. The Scarecrow returns to unite an impressive roster of super villains to destroy The Dark Knight forever.\nPlayStation Exclusive Scarecrow Nightmare Missions: As Gotham City falls victim to Scarecrow's fear toxin, tear through the city in the all-new Batmobile and face off against a towering vision of Scarecrow and his undead army.\nPlayStation Exclusive Custom Batman and Batmobile Skins: Fight crime in the futuristic Justice League 3000 Batman skin or go retro the Batman Classic TV Series Batman and Batmobile skins.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41PmJvHZ2ML.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/PlayStation-Batman-Arkham-Limited-Edition-4/dp/B00VETEZ34%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00VETEZ34", rating: 4.8, category: "Video Games"},
