  {name: "PlayStation 3 Dualshock 3 Wireless Controller (Blue)", price: 47.06, description: "The only Bluetooth controller for the PS3 system;\nHours of comfortable game play with ergonomically designed grips;\nFeel every hit, crash, and explosion with hand-vibrating DUALSHOCK response\nTruly intuitive game play through the motion sensing SIXAXIS technology;\nPlay wirelessly with up to seven friends;\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41ckQk3FzvL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/PlayStation-Dualshock-Wireless-Controller-Blue-3/dp/B002GJRQRS%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB002GJRQRS", rating: 4.2, category: "Video Games"},
  {name: "PlayStation Portable 3000 Core Pack System - Piano Black", price: 145.0, description: "Piano Black PlayStation Portable includes built-in microphone\nListen to MP3s and watch full-length movies\nBuilt-in WiFi lets you access the Internet from any accessible hotspot\nMemory Stick Duo slot for storage expansion\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/417Ec%2B5AA3L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/PlayStation-Portable-3000-System-Sony-PSP/dp/B001KMRN0M%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB001KMRN0M", rating: 0.0, category: "Video Games"},
  {name: "NHL 2K9 - PlayStation 2", price: 4.13, description: "Pro Stick - New for the PlayStation 2 Computer Entertainment system, right stick shooting and puck handling provide an entirely new level of control\nAll-New Commentary - by Randy Hahn and Drew Remenda bring all the on-ice action to life like never before\n2K Beats -- Featuring Pennywise, Bad Religion, The Offspring, NOFX, The Ramones, Inner Circle, Mastodon, Operation Ivy, High on Fire and more\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/516BIK2LwOL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/NHL-2K9-PlayStation-2/dp/B001B0BB4M%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB001B0BB4M", rating: 3.1, category: "Video Games"},
  {name: "Graco Pack 'N Play Playard Smart Stations, Sapphire", price: 199.99, description: "Portable changing station can be used in or out of the playard, for easy diaper changes in any room\nIntegrated changer storage can hold diapers, wipes and other essentials, so you have what you need at your fingertips\nPortable travel bed gives baby a nap spot in any room, so you can keep baby close around the house\nRoomy storage organizer with a removable hamper keeps clothes and diapers organized\nMusic and nature sounds keep baby content, while two-speed vibration soothes and relaxes\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/410xQYRcMvL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Graco-Playard-Smart-Stations-Sapphire/dp/B00H8MRDXA%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00H8MRDXA", rating: 0.0, category: "Baby Product"},
  {name: "Graco Pack 'n Play with Newborn Napper Station LX Play Yard - Caraway", price: 109.99, description: "The only playard designed to transition from newborn to infant to toddler. Newborn Napper® station with beautifully-styled, extra-soft micro-fleece fabric to cuddle baby\nConvenient carrying bag for no-fuss travel and storage\nElectronics module with songs and soothing sounds. Overhead toy bar with detachable soft toys offers visual stimulation\nNew, larger changing table holds safe for use with babies up to 30 pounds. Napper for use only for infants under 3 months of age and unable to roll over. Bassinet for babies under 15 lbs. and unable to push up on hands and knees. Playard for children unable to climb out, under 35\" tall.\nSignature Graco® push-button fold makes closing your playard quick and hassle-free\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/31D45n-gciL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Graco-Pack-Newborn-Napper-Station/dp/B00BH0OPJE%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00BH0OPJE", rating: 0.0, category: "Baby Product"},
