  {name: "New Super Mario Bros. Wii", price: 22.95, description: "New items include the propeller suit, which will shoot players high into the sky with just a shake of the Wii Remote\nNew Super Mario Bros. Wii offers a combination of cooperation and competition.\nSupports 2-4 players in multiplayer mode.\nMario, Luigi and two Toads are all playable characters, while many others from the Mushroom Kingdom make appearances throughout the game\nPlayers can use the motion abilities of the Wii Remote controller.\nThe first player to reach a seesaw might make it tilt to help his or her character\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51Bs4LPWpaL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/New-Super-Mario-Bros-Wii-Nintendo/dp/B002BRZ9G0%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB002BRZ9G0", rating: 0.0, category: "Video Games"},
