  {name: "Wii Dual Charging Station w/ 2 Rechargeable Batteries & LED lights for Wii Remote Control", price: 7.94, description: "2 x New high capacity NiMh rechargeable battery packs.Higher capacity than AA batteries.\nRechargeable up to 500 times.\nCharge up to 2 Wii remotes simultaneously.\nCharge through the USB port on the back of Wii system or any other USB devices.\nLED charge indicator light.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41REOZfl-9L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Wii-Charging-Station-Rechargeable-Batteries-Nintendo/dp/B003ZWB7FC%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB003ZWB7FC", rating: 3.2, category: "Video Games"},
  {name: "Wii Mini with Mario Kart Wii Game - Red", price: 99.99, description: "The Wii features some of the most beloved franchises in gaming, including Mario and friends, The Legend of Zelda and Super Smash Bros.\nThe Wii is home to nearly 1,400 disc-based games, and almost all of them are compatible with the Wii mini.\nThe Wii Remote Plus delivers enhanced motion control, allowing you to swing your controller like a baseball bat, twist it like a key, thrust it like a sword and more to accomplish corresponding actions in your games.\nThe Wii mini comes in a black and red design with a matte finish. Includes matching red Wii Remote Plus and Nunchuck controller accessory.\nRace your way through the Mushroom Kingdom with Mario and the gang and get access to a variety of karts, cycles and crazy power-ups in the included Mario Kart Wii video game.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51z2e58TtSL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Wii-Mini-Mario-Kart-Game-Nintendo/dp/B00F2ENJY8%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00F2ENJY8", rating: 0.0, category: "Video Games"},
