  {name: "Just Dance 2015 - Wii", price: 24.49, description: "Just Dance 2015 is the latest, most awesome-filled version of the world's #1 dance game!\nBringing new moves and game modes to over 40 top tracks, Just Dance 2015 features hit songs like \"Maps\" by Maroon 5, \"Bang Bang\" by Jessie J, Ariana Grande & Nicki Minaj plus legendary favorites like \"Walk This Way\" by Run DMC & Aerosmith.\nOnline multiplayer is back: With the World Dance Floor feature, dance with anyone anywhere in the world in Just Dance's exclusive online multiplayer mode!\nNever dance alone: With the new Dance Challenge Mode feature, compete against anyone-from friends and family to top ranked Just Dancers.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/61Miap78l8L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Just-Dance-2015-Wii-Nintendo/dp/B00KTNSKZU%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00KTNSKZU", rating: 0.0, category: "Video Games"},
  {name: "Eforcity Dual Charging Station w/ 2 Rechargeable Batteries & LED Light for Wii Remote Control, Black - (Original Wii Controllers Not Included) Retail Packaging", price: 13.99, description: "Never run out of battery power when you are about to score the winning point with this dual charging station for Nintendo Wii.\nSave money and protect the environment by using the rechargeable battery. High capacity battery that lasts 2~4 times longer than the standard AA batteries.\nDock both of your remote and plug it into any USB port - no need to remove the battery. LED light glow from the base of the dock station to show the batteries charging status. Color: Black.\nPackage includes: 2 Ni-Cd Rechargeable battery; USB cable; Dual Remote Control Charging Dock.\nAccessory ONLY, Nintendo Wii remote control not included.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51nRlmGRI0L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Eforcity-Charging-Rechargeable-Batteries-Wii-Nintendo/dp/B004IK24MU%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB004IK24MU", rating: 0.0, category: "Video Games"},
  {name: "Mario Kart Wii", price: 29.4, description: "Perform speed-boosting flips and wheelies with the flick of a Wii Remote, or grab a Wii Wheel for even more fast-paced fun!\nPlay friends locally on a single Wii\n2008 software - racing wheel not included\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51P0eLWqnuL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Mario-Kart-Wii-Nintendo/dp/B001GIUWX0%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB001GIUWX0", rating: 0.0, category: "Video Games"},
