  {name: "Wii Sports Resort", price: 29.8, description: "Features -\nWuhu Island has so many things to do, there's never a dull moment; a dozen activities await visitors - Archery, Frisbee, Basketball, Cycling, Canoeing, Power Cruising, Table Tennis, Air Sports, Bowling, Swordplay, Golf and Wakeboarding\nThe activities use the precision controls of the Wii MotionPlus accessory to help players come much closer to the physical reality of engaging in the actual sports; every real-world action, whether it's a perfect drive on the fairway or a slice off the course, is meant to be faithfully replicated\nEach activity has multiple fun challenges designed to keep visitors coming back for more; basketball players might compete in a three-point shootout or jump into a three-on-three pickup game; archery enthusiasts must aim for the bull's-eye across ever-increasing distances and obstacles\nDifferent activities use the Wii Remote and Nunchuk controllers in different ways; for example, hold the Wii Remote like a paddle in Canoeing, while in Cycling they use both arms to pedal with the two controllers; the Wii MotionPlus accessory picks up every nuance of motion and translates it onto the TV screen\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51dCSmLOoaL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Wii-Sports-Resort-Nintendo/dp/B004W1IX1G%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB004W1IX1G", rating: 4.7, category: "Video Games"},
  {name: "Super Smash Bros. Brawl", price: 23.95, description: "See your favorite Smash Bros. character, redesigned from their most recent games, brawl onto your screen once again!\nA host of new characters to fight with, including Sonic, Pit from Kid Icarus, Wario and Diddy Kong\nMore than a dozen gorgeously-rendered stages\nNew special moves and attacks, including the groundbreaking Final Smash\nNew items and assist trophies\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/61hsaXfwE3L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Super-Smash-Bros-Brawl-Nintendo-Wii/dp/B000FQ9R4E%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB000FQ9R4E", rating: 4.5, category: "Video Games"},
  {name: "Mario Kart 8 - Nintendo Wii U", price: 45.9, description: "Race along walls and upside-down on twisting anti-gravity racetracks!\nShare highlight videos of your greatest moments with friends via the Mario Kart TV feature and Miiverse.\nRace and battle with friends locally or connect online to play with random players from around the world.\nFan favorite features from past Mario Kart games include gliders, underwater racing, motorbikes, mid-air tricks, and more.\nCrisp HD graphics and fluid animation offers players the most visually stunning Mario Kart yet!\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51puTCYdNeL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Mario-Kart-8-Nintendo-Wii-U/dp/B00DC7G2W8%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00DC7G2W8", rating: 4.7, category: "Video Games"},
  {name: "Lego Star Wars: The Complete Saga - Nintendo Wii", price: 10.19, description: "Play through the events of all 6 Star Wars movies in 1 videogame for the first time ever\nSolve puzzles that encourage creative thinking through the use of teamwork and unique building situations\nNew characters bring the total count to over 160; upgraded Character Customizer\nEnhanced Force powers; new power-ups; new Challenge mode; revamped levels\nWii version provides motion-sensitive inputs for exciting new ways to control the LEGO Star Wars characters\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51VjlsQigLL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Lego-Star-Wars-Complete-Saga-Nintendo/dp/B000R3BNDI%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB000R3BNDI", rating: 0.0, category: "Video Games"},
  {name: "Super Mario Galaxy (Nintendo Selects)", price: 12.95, description: "Shake, tilt and point! Mario takes advantage of all the unique aspects of the Wii Remote and Nunchuk controller.\nUnleashing new moves as you shake the controller and even point at and drag items with the pointer.\nPerform mind-bending, low-gravity jumps across wild alien terrain as they experience platforming for a new generation\nMultiplayer features for two gamers playing together\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51MWtqnMzOL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Super-Mario-Galaxy-Nintendo-Selects-Wii/dp/B005FYJA52%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB005FYJA52", rating: 0.0, category: "Video Games"},
