  {name: "Wii Sports", price: 30.99, description: "Original edition, comes in cardboard sleeve, not typical game case\n5 Games in 1: Boxing, Bowling, Golf, Tennis, Baseball\nThis is the standalone game - this game also comes bundled with the Wii\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/511vBBiKpGL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Wii-Sports-nintendo/dp/B0017Q4DGI%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB0017Q4DGI", rating: 4.4, category: "Video Games"},
  {name: "Nintendo Wii Console, White (NEWEST MODEL)", price: 150.0, description: "The newly configured Wii console is designed exclusively for Wii game play and entertainment experiences\nBundle Includes: Wii Console, Wii Remote Plus, Nunchuk, Wii Remote Jacket, Sensor Bar, Wii AC Adaptor, Wii AV Cable\nWii Remote Plus offers precision control during gameplay\nBuilt-in Wi-Fi Access For Easy Connection To Internet\nNetflix instant streaming functionality allows for thousands of movies, TV shows, cartoons and more right on your TV\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41a5xmHxIzL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Nintendo-Wii-Console-White-NEWEST-MODEL/dp/B00AFYAUYW%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00AFYAUYW", rating: 0.0, category: "Video Games"},
  {name: "Wii Play", price: 14.9, description: "Once you pick up WiiPlay's nine quick and easy games, you'll have a hard time putting them down!\nIncludes nine games total!\nWith the WiiRemote's intiuitive controls, anyone can master Billiards, Fishing, Shooting Range, and any of the Wii games with ease!\nPlay multi player games together with your friends with a diverse selection of different types of games!\nThis product comes with the game disk only, no Wiimote inlcuded!\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51rBIjHkMVL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Wii-Play-Nintendo/dp/B0013E9HP6%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB0013E9HP6", rating: 0.0, category: "Video Games"},
  {name: "New Classic Pro Controller For Nintendo Wii/WiiU White", price: 4.99, description: "Up for sale is The Classic Controller Pro\nDesigned to work together with the Wii Remote controller on the Wii video game system and Created for accessibility and comfort\nThe Classic Controller Pro is primarily used for playing Virtual Console games on the Wii Shop Channel (not compatible with Nintendo GameCube games).\nUse the control pad along with the A and B buttons for a familiar experience when playing Nintendo Entertainment System games\nStylish controller is comfortable to hold, even during extended gaming sessions\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/213qfTm7GzL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Classic-Controller-Nintendo-WiiU-White-Pc/dp/B003YC4D9A%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB003YC4D9A", rating: 3.2, category: "Video Games"},
  {name: "Nintendo Wii Console w/Skylanders Giants Starter Pack", price: 169.99, description: "USB Input: Yes\nHDMI Output: Not Available\nWiFi Built In: Yes\nGraphic Quality: 480p\nSupported Flash Memory Cards: Not Available\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41HozsP8J8L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Nintendo-Console-Skylanders-Giants-Starter-Pack/dp/B006AN894U%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB006AN894U", rating: 0.0, category: "Video Games"},
  {name: "Mario Party 9", price: 34.0, description: "Players ride across stages together in special vehicles. Players take turns as Captain of the vehicle by hitting Dice Blocks to move the party forward, hoping to land on lucky spaces.\nFrom Toad Road to Boo's Horror Castle, players will encounter a wide variety of familiar Mario franchise elements in new environments that can be enjoyed solo or with friends.\nIn Mario Party 9, each themed stage has a clear destination point but with multiple paths along the way, so no two games will play the same. Every time they play, players can earn Party Points that are used to unlock special items and features.\nEach stage culminates in a Boss Battle. Collectively, players must combine their strength to defeat classic foes such as Bowser and King Boo while still playing competitively to boost their own individual scores.\nIncludes 80 outrageous new minigames that find players making pizzas, escaping haunted mansions, and racing snowmobiles\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/611aSy2ZycL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Mario-Party-9-Nintendo-Wii/dp/B0050SVGU0%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB0050SVGU0", rating: 0.0, category: "Video Games"},
  {name: "Super Mario Maker - Nintendo Wii U", price: 51.77, description: "Create and play the Mario levels of your dreams\nPlay a near limitless number of intensely creative Super Mario levels\nNintendo has made Mario games for decades. Now... it's your turn!\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51LFCvDgEhL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Super-Mario-Maker-Nintendo-Wii-U/dp/B00KWFCSB2%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00KWFCSB2", rating: 0.0, category: "Video Games"},
  {name: "Nintendo Pro Controller Black - Nintendo Wii U", price: 45.48, description: "Wii U Pro Controller - Black\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41ztGRGyC4L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Nintendo-Pro-Controller-Black-Wii-u/dp/B00MUY0OFU%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00MUY0OFU", rating: 0.0, category: "Video Games"},
  {name: "Just Dance: Disney Party - Nintendo Wii", price: 12.99, description: "Twenty-Five Brand-New Dances and Choreographies - Classic Disney songs for the whole family and dances from the hottest Disney Channel shows.\nFamily Fun and Party Fun - Play cooperatively for the highest team score or play Freeze & Shake for extra points.\nSpecial Features for the Wii - Classic four-player co-op on Wii and a unique Balloon mode where kids compete against each other to get more items and earn more points by shaking their Wii Remote.\nNew and Improved Features Offer Strong Benefits for Parents - Playlists allow mom to select all her kids' favorite songs for nonstop dancing and on-screen lyrics help kids learn the words and sing along as they dance.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/615BppBphlL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Just-Dance-Disney-Party-Nintendo-Wii/dp/B0088I8M10%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB0088I8M10", rating: 0.0, category: "Video Games"},
  {name: "Generic Dual Wii Remote Charger Charging Station with Battery Packs", price: 11.98, description: "Use this charging station to charge up to two (2) Wii controllers at a time.  Light shines red when charging and blue once charged.\nPackage contents include: 1 x dual charging station, 2 x 2800mAh battery packs, 1 x USB Plug\nIndicator Lights: Red=Charging; Blue=Fully Charged\nColor: White\nNote: Not manufactured by Nintendo\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41SubYHrfjL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Generic-Wii-Charger-Charging-Station-Nintendo/dp/B003DSAT0C%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB003DSAT0C", rating: 3.5, category: "Video Games"},
  {name: "Wii Hardwear Remote Cachet - Pink", price: 1.26, description: "Motion activated moving designs\nRubberized battery door\nHeavy duty strap to keep your remote in your hand where it belongs.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/4108VyOdnbL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Wii-Hardwear-Remote-Cachet-Pink-Nintendo/dp/B0013YM89S%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB0013YM89S", rating: 2.6, category: "Video Games"},
  {name: "Angry Birds Star Wars - Nintendo Wii", price: 2.8, description: "All new competitive and cooperative multiplayer modes\n20 exclusive new levels created just for the console game\nOver 25 hours of engaging gameplay\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51o2TZ2fuZL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Angry-Birds-Star-Wars-Nintendo-Wii/dp/B00DWXV2EU%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00DWXV2EU", rating: 4.3, category: "Video Games"},
  {name: "Teenage Mutant Ninja Turtles - Nintendo Wii", price: 14.41, description: "Play as your favorite Turtle anytime! Booyakasha!\nImpressive, show-off combo system and combat sequences.\nJoin the Turtle Power with 4-players co-op multiplayer!\nBattle through 15 action-packed levels based on the TMNT universe.\nCollect and eat pizza to increase your Turtle's health!\nNavigate through more than a dozen environments including the sewers, docks, city streets and subways.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/518VeGpX5DL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Teenage-Mutant-Ninja-Turtles-Nintendo-Wii/dp/B00DWXV074%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00DWXV074", rating: 0.0, category: "Video Games"},
  {name: "Nintendo Wii Console White with Wii Sports", price: 235.0, description: "Provides an immersive, engaging experience like no other, where the player is more connected to the game than ever before.\nWii Remote: Wii Remote utilizes motion sensor.\nControl allowing players to be a part of the game through natural and  intuitive movementUse\nWii offers entertainment for every member of  the household.\nAnyone of any age or skill level can pick up and play  games on the Nintendo Wii\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/31CrCpg9ksL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Nintendo-Wii-Console-White-Sports-TV/dp/B00GVAK576%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00GVAK576", rating: 3.9, category: "Video Games"},
