  {name: "Donkey Kong Country Returns", price: 32.29, description: "Dual control schemes including the Wi Remote/Nunchuk, as well as a sideways oriented Wii Remote\nThe game offers the traditional side-scrolling experience everyone loved, but also levels created in fully rendered 3D environments\nNew silhouetted level s add additional challenges as players work to time movements and attacks\nFor the first time ever, the franchise features the ability for two people to play together at the same time - one as Donkey Kong, one as Diddy Kong\nHidden items, puzzle pieces and other surprises are found all through the jungle; spell out K-O-N-G by the end of each level to earn an extra bonus\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/611-qhf%2BMSL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Donkey-Kong-Country-Returns-Nintendo-Wii/dp/B003ZHMMEM%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB003ZHMMEM", rating: 0.0, category: "Video Games"},
