  {name: "Logitech K380 Multi-Device Bluetooth Keyboard, Dark Grey (920-007558)", price: 39.99, description: "Multi-device Bluetooth keyboard: Universal keyboard for typing on all your computing devices*: Windows, Mac, Chrome OS, Android, iPad, iPhone, Apple TV 2nd or 3rd generation (*Any Bluetooth-enabled computers or mobile devices that support external keyboards with HID profile. Check with device manufacturer for details)\nEasySwitch: Connect up to three devices simultaneously and switch between them at the touch of button\nCompact mobile keyboard: Easy to carry around your home for familiar typing in any room\nOSadaptive: Automatically recognizes each device and maps keys to give you a familiar layout, including shortcuts\nTwo year battery life*: Virtually eliminates the need to change batteries (*Keyboard battery life calculation based on an estimated two million keystrokes/year in an office environment. User experience may vary.)\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51mqss0bXEL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Logitech-Multi-Device-Bluetooth-Keyboard-920-007558/dp/B0148NPH9I%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB0148NPH9I", rating: 0.0, category: "Personal Computer"},
  {name: "Logitech G500s Laser Gaming Mouse with Adjustable Weight Tuning", price: 69.81, description: "Weight and balance tuning adjust to unique play styles, including overall weight, center of gravity, and placement of weights\nAdvanced surface materials include hydrophobic coating of palm area, dry-grip sides and fingerprint resistant coating of primary buttons\nIn-game sensitivity switching with multiple DPI settings up to 8200 DP\nOnboard memory profile for game-specific setup\n2 meter braided USB cable\nAdjustable weight and balance tuning: Mix and match up to 27 grams of extra weights for a personalized feel and control\n10 programmable buttons and on-board memory: Perform single game commands or intricate macros with a simple button click, plus store your settings in the mouse so you can take them with you\nDual-mode scroll wheel: Instantly switch from click-to-click mode to hyper-fast scrolling\nOn-the-fly adjustable DPI (200-8200): Shift through multiple DPI settings without interrupting game play\nLaser precision for Windows PCs: Gaming-grade control for Windows 8, Windows 7 and Windows Vista\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41EEnvJ01UL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Logitech-Gaming-Adjustable-Weight-Tuning/dp/B00CJD4HD2%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00CJD4HD2", rating: 0.0, category: "Personal Computer"},
