  {name: "Tear Stain Remover for Dogs and Cats Gently Cleans & Removes Dog Tear Stains without Chemicals - Try our Natural Formula for Your Shih Tzu, Poodle, Maltese and Chihuahua - Made in USA 100% Guarantee", price: 19.5, description: "✚ TWIST TOP DISPENSING NOZZLE FOR EASY USE: A more convenient and precise way to control the amount dispensed compared to other brands. Our nozzle and application process is user friendly - simply twisting the nozzle up and down ensures you control the amount applied. Just as effective as tear stain remover pads and tear stain wipes, our tear stain remover for dogs also comes in a large 8 oz / 237 ml bottle, meaning a little really goes a long way!\n✚ GENTLE, KIND AND EFFECTIVE: We understand that your dogs eyes are sensitive, that's why our kind and gentle tear stain remover helps clean gunk, remove build-up and ease crusting without the need for excess rubbing. Through continued daily use our tear stain remover will help to eliminate ugly eye tear stains, prevent eye discharge and infections, lightening existing stains while keeping the coat moisturized. You can rest assured that our gentle ingredients have been formulated to safely and effectively remove unsightly puppy and dog tear stains.\n✚ NATURALLY DERIVED, MADE IN THE USA: Our naturally derived ingredients are made from coconut and palm and are fragrance free, which is not only important when placing them so close to your dog's very sensitive nose, but also ensures there's no bad aftertaste when they bathe with their tongue. Our dog tear stain remover is cruelty free, made in the USA, contains no bleach or harsh chemicals, and is safe for both dogs and cats, making it a great natural alternative to chemical tear stain removers. Harmful chemicals are a no-no for pets just as much as for humans. Our Company philosophy is that equal care should be taken when choosing a product for our pets, as we would for ourselves. Unlike some other brands, we pride ourselves on the fact that our formula is free from any parabens, MEA or DEA, sulfates, phosphates, alcohol, antibiotics and steroids, ensuring it's a safe tear stain remover for puppies over 12 weeks old, too.\n✚ YOUR FUR BABY WILL LOVE YOU: Let your dog's pretty eyes sparkle again, giving them the beautiful eyes they deserve. Our tear stain remover for white dogs works well in between grooming appointments and on dogs such as Maltese, Chihuahua, Shih Tzu, Lhasa Apso, Cocker Spaniel, Daschund, Poodle, Bichon Frise, Yorkie, Pekingese, Bulldog, Shar Pei and Pug. You can also use our tear stain remover for cats like Persian, Chinchilla, Himalayan and Exotic Shorthair. We guarantee you'll be recommending it to all your friends!\n✚ USEFUL TIPS & LIFETIME GUARANTEE: Along with genetics, diet plays a big role in tear staining. In addition to using our tear stain remover for dogs veterinarians recommend a well-researched, high-quality, species-appropriate balanced diet of some kind, from a major manufacturer. Dyes contained in dog food can also contribute, so if your dog isn't eating a premium diet, switching now might help. Feeding a dry kibble with no preservative, fillers or additives can boost the resistance to inflammatory reactions and help to reduce tear staining. Beef, chicken and wheat are the top 3 allergens and white dogs especially tend to be more predisposed to allergies, which exacerbates staining. If the problem persists, stocking 5 or so foods and switching at mealtimes may help. This can lessen the ability for a dog's body to develop new allergies, re-balancing any nutrients or minerals that any one food may be deficient in. A high mineral content in your dog's drinking water is also thought to contribute to staining. We recommend our customers try serving distilled or filtered water out of a stainless steel or ceramic bowl, as over time plastics tend to wear down creating an environment where bacteria can thrive, providing the perfect breeding ground for bacteria and yeast to grow on the fur. Environmental toxins also contribute to tearing. That includes cleaning products, laundry products and anything with a fragrance, as well as pesticides, petroleum products and lawn and garden chemicals. Any fur stain that remains after a week of using our tear stain remover for dogs is dyed fur that requires growing out and gently trimming away. Thereafter, weekly maintenance as a preventative measure will help prevent those pesky locked-in stains! In addition to Amazon's 30-day refund policy, we back our products with a Lifetime Guarantee. If you aren't completely satisfied with the results, simply contact us and we'll give you a full refund. There's no risk when you order today!\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51iV7eg72-L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Remover-Gently-Removes-without-Chemicals/dp/B012LMPWI4%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB012LMPWI4", rating: 0.0, category: "Pet Products"},
