  {name: "UP by Jawbone - Medium - Retail Packaging - Onyx (Discontinued by Manufacturer)", price: 36.99, description: "UP is compatible with the Amazon Fire phone and devices running Android 4.0 (Ice Cream Sandwich) or and iOS 6.0. Log what you eat / drink & track nutritional info\nPlug in to sync. Designed to be worn 24/7, with up to 10 days of battery life. Track your activity: steps; distance; calories burned; time spent active versus idle\nTrack your sleep: total hours; light versus deep; length of time to fall asleep\nFor pairing related issues please following instructions: 1.\tLift the sides carefully (with tape) to open the lid. 2.\tInside you will have the charging cable. Not needed to begin but you'll need it shortly to get your band 10-day battery life.3.\tDownload the Up app for the iPhone or Android coming soon.\n4.\tTake the band cap off and prepare for syncing.5.\tTightly insert the band into the phone through the 3.5 jack6.\tLet is sync to 100% before removing. After it syncs you'll be able to enjoy all the data the Up band has collected. 7.\tAfter a second or two it should start to sync. If you are having problems try taking it out and putting it in again. 8.\tCreate an account. So you can start syncing your Up band with your phone.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41VNQLswpoL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/UP-Jawbone-Packaging-Discontinued-Manufacturer/dp/B00A17IAO0%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00A17IAO0", rating: 0.0, category: "Wireless"},
