ional Videos, Tutorials, and a Cupping Community for you to interact with to learn and share cupping secrets.Easy to Clean. Best Used in Shower.  Apply Facial Wash and use face cup to glide across the skin. Use Eye/lip Cup for suctiona and release around eyes, eyelids, on and around lips and nose. Cupping Set also great for Sinus Pressure, Sinus Drainage, Sinus Congestion, Lip Plumping, Toning Facial Muscle Tone, TMJ, Draining Lymph\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/411B55ab2JL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/WAREHOUSE-Cupping-Reducing-Membership-Tutorials/dp/B00UAZDQ8S%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00UAZDQ8S", rating: 0.0, category: "Beauty"},
