 eyelash and eyebrow growth needs. It is manufactured in a standard eyeliner style container that is simple to use and easy to apply. The 3.5 ml applicator will last you approximately for FOUR MONTHS. Please make sure that all makeup and any other cosmetic products have been completely removed prior to application. Starting from the inner corner of your lash line and working outward, draw the applicator tip carefully along the skin at the base of the upper eyelashes in one continuous move. DO NOT apply our Eyelash Serum to the lower eyelashes nor directly to the eye surface. Use it no more than once daily for ultimate results.\n100% SATISFACTION OR YOUR MONEY BACK Try our Revolutionary Advanced Eyelash & Eyebrow Enhancer, you'll love its wonderful effects! If for some reason you are not completely satisfied with Skinology Beauty Solutions Eyelash Serum - contact us and receive a full refund - No questions asked!!!- You don't even need to return the product! Try It Risk Free!\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41LIOVnRI-L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Eyelash-Growth-Serum-Pentapeptide-17-Dermatologist/dp/B014LN7LOE%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB014LN7LOE", rating: 0.0, category: "Beauty"},
