TISFACTION GUARANTEE. On top of that we also have a LIFETIME FREE SAFETY REPLACEMENT WARRANTY. If your ring is damaged (even during high performance wear) and the breakage protects your finger from damage (as it is designed to do) just let us know the details of the event and you will receive a Replacement Ring. No hassles.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41mTzwTjZ%2BL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Performance-Ring-Electricians-Adventurers-HypoAllergenic/dp/B00QSE7G86%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00QSE7G86", rating: 0.0, category: "Sports"},
